import react from "react";
import styled from "styled-components";

const Logo = (props) => (
  <Container>
    <Image source={props.image} resizeMode=""/>
    <Text>{props.text}</Text>
  </Container>
);

export default Logo;

const Container = styled.View``;

const Image = styled.Image`
  width: 36px;
  height: 36;
`;

const Text = styled.Text``;
